import "./Posts.css";

export default function Posts({posts}) {
  return (
    <div className="posts">
      <Post img="https://prod-virtuoso.dotcmscloud.com/dA/188da7ea-f44f-4b9c-92f9-6a65064021c1/heroImage1/PowerfulReasons_hero.jpg" />
